import React, { Component } from 'react';
import CloseOutlinedIcon from '@material-ui/icons/CloseOutlined';

class EmployeeAssignmentsPopup extends Component {
    constructor(){
        super()
        this.state = {

        }
    }
    close = () => {
        this.props.closePopup()
    }
    handleSelect = (m) =>{
        this.props.updateParent('assignment',false)
        setTimeout(() => {
            this.props.updateParent('assignment',m) 
        }, 20);
    }

    render() {
        const {assignments_list} = this.props
        return (
            <div className='employee__page__assignments__suggestions'>
                <section className="overlay"></section>
                    <div className='employee__page__assignments__suggestions__content'>
                        <button
                        type ='button'
                        onClick = {() => this.close()}><CloseOutlinedIcon /></button>
                    <ul>
                    {assignments_list && assignments_list.length > 0 ? 
                    assignments_list.map(m => {
                    return <li
                    onClick = {() => this.handleSelect(m)}
                    className='flex__start'
                    key = {m._id}>{m.title}</li>
                    })
                :'  '}
                    </ul>
                    </div>
            </div>
        );
    }
}

export default EmployeeAssignmentsPopup;
